@therooseveltcoffeehouse turning 10 years old is special for me. As a new Councilmember chairing the small business committee, I held my first hearing -not- at City Hall right but here in this coffee shop on E Long St.

Swipe right for an illustration of a 2019 scene in the shop — that is comic book versions of me, @lizclarkebrown, and @aslyner milling around!

Congrats @kennysipes - your idea has become an institution in this City, where people come together to spark positive change. Thank you for this indispensable gathering space.

